angular.module("starter.controllers")

.controller("friendsCtrl", function($scope, $rootScope, $http, $ionicPopup, $ionicLoading, $ionicModal, $timeout, $cordovaSocialSharing, $filter,  FRIEND, settings) {
    $scope.friends = [];

    $scope.loading = true;

    var trans = $filter('translate');

    $scope.info_facebook = trans('friends.info_facebook');

    $scope.empty_list = trans('friends.empty_list');

    $scope.onRefresh = function() {
        FRIEND.all()
        .then(function(data) {
            $scope.friends = data;
            $scope.loading = false;
            $scope.$broadcast('scroll.refreshComplete');
        });
    };


    $scope.doFacebook = function() {
        $scope.loading = true;
        FRIEND.addOnFacebook()
        .then(function() {
            $scope.onRefresh();
            $rootScope.user.is_facebook = true;
        },
        function() {});
    };

    $scope.doInvite = function() {

        facebookConnectPlugin.showDialog({
            method: "send",
            caption: "Check this out.",
            link: "http://livr.io/get",
            description: "The site I told you about",
            picture: "http://img.livr.io/user/livrio.png"
        });
        return;

        facebookConnectPlugin.appInvite(
            {
                url: "https://fb.me/887481444681051",
                picture: "http://img.livr.io/user/livrio.png"
            }, 
            function(obj){

                if(obj) {
                    if(obj.completionGesture == "cancel") {
                        // user canceled, bad guy
                    } else {
                        // user really invited someone :)
                    }
                } else {
                    // user just pressed done, bad guy
                }
            }, 
            function(obj){
                // error
                console.log(obj);
            }
        );

        /*
        var image = 'data:image/png;base64,';

        $cordovaSocialSharing
        .share(trans('friends.invite_msg'), trans('friends.invite_subject'), image, trans('friends.invite_link'))
        .then(function(result) {
          // Success!
        }, function(err) {
          // An error occured. Show a message to the user
        });
*/
    };



    $scope.onRefresh();


    $rootScope.$on("friend.refresh",function() {
        $scope.onRefresh();
    });

});
